    <div> <a href="{{character[col]}}"> $</a></div>-->
    <!--<div *ngIf="isLast" class="component-tag-sm">
        <span>app-table-row</span>
    </div>-->
    <div  class="text">
       <span style=" overflow-wrap: break-word;">  {{character[col]}}</span>
    </div>
    <figure class="col-md-4">

        <a (click)="toggle(character['age'])" class="black-text" target="iframe_a" href="{{character[col]}}"
           data-size="60x106">
            <img alt=".." src="{{character[col]}}"
                 width="100" />

            <h3 class="text-center my-3"></h3>
        </a>
    </figure>
</td>



